import { Link } from "react-router-dom";


const Navbar = () => {
    return (
        <div className="nacbar">
            <div className="logo">
                <h1>Book Hub</h1>
            </div>
            <div className="links">
                <Link to={"/"} >Home</Link>
            </div>
        </div>
      );
}
 
export default Navbar;
